 * @example
 * import { check, isLessThan, TinyType } from 'tiny-types';
 *
 * class InvestmentPeriodInYears extends TinyType {
 *     constructor(public readonly value: number) {
 *         check('Investment period in years', value, isLessThan(50));
 *     }
 * }
